export default function registra(item){
    const cargoUtil = JSON.stringify(item);
    alert(cargoUtil);
    fetch("http://localhost/registrase.php",{
        method:"POST",
        headers: {
            "Content-Type":'application/json'
        },
        body: cargoUtil
    }).then(res=>res.json()
    ).then((res)=>console.log(res)).catch(e=>console.log(e));
}
